<template>
  <transition name="list">
    <div class="body">
      <div class="flex header">长按保存图片后可分享给朋友</div>
      <img :src="myqrurl" class="spread-img">
      <canvas ref="spread" width="600" height="1074" class="spread hidek" style="width: 300px; height: 485px;"></canvas>
      <img class="spreadimg hidek"
           src="data:image/png;base64,">
      <img class="spreadqr hidek" ref="qrimg" @load="_setcanvas">
      <div class="open-share flex fw ss" @click="_showShare">
        <p class="flex">推荐</p>
        <p class="flex">文案</p>
      </div>
      <div class="share flex fw" :class="{'shownow': show}">
        <h1 class="flex">推荐文案</h1>
        <p class="flex">{{share[share_index]}}</p>
        <div class="share-btn flex" @click="_pushShare">换一个</div>
        <div class="share-btn flex red-btn copy" :data-clipboard-text="share[share_index]" id="copy" @click="">复制</div>
      </div>
      <interlayer ref="interlayer" @close="_close_interlayer"></interlayer>
      <back ref="back"></back>
      <img src="https://cdn.xingkwh.com/copy--1.png" class="hiden-copy" :class="{'show-copy': first_show}"
           @click="_close_interlayer">
    </div>
  </transition>
</template>

<script>
  import ClipboardJS from 'clipboard'
  import popup from 'base/popup/popup'
  import back from 'base/back/back'
  import interlayer from 'base/interlayer/interlayer'
  import QRCode from 'qrcode'
  import {NOWCONFIG} from 'api/app_config'
  import {env} from 'api/config'

  export default {
    name: 'spread',
    data() {
      return {
        myqrurl: 'https://cdn.xingkwh.com/down.png',
        NOWCONFIG: null,
        share: ['进入抖音千万级流量池的秘诀，成为网红的必经之路！抖音营销一步到位，识别二维码进入，探索流量内幕！', '成为抖音合伙人，全网最低成本货源，每日可躺赚千元，手把手教你玩转短视频流量营销！', '抖音合伙人三级推广返佣，永久锁定下级，全网最低成本价，稳定高效平台，新码首出赶紧占位！'],
        share_index: 0,
        show: false,
        env: 'qzone',
        first_show: true
      }
    },
    created() {
    },
    mounted() {
      this.NOWCONFIG = NOWCONFIG
      this.env = env
      this.$refs.back._hiden()
      this.$refs.interlayer._showLayer()
      setTimeout(() => {
        this._initCopy()
        this._showqr()
      }, 200)
    },
    methods: {
      _close_interlayer() {
        this.show = null
        this.first_show = null
        this.$refs.interlayer._hiddenLayer()
        this.$refs.back._show()
      },
      _pushShare() {
        if (this.share_index > 1) {
          this.share_index = 0
        } else {
          this.share_index += 1
        }
      },
      _showShare() {
        // this.$refs.share._showPopup()
        this.show = true
        this.$refs.interlayer._showLayer()
        this.$refs.back._hiden()
      },
      _setcanvas() {
        try {
          let canvas = document.querySelector('.spread')
          let imgbg = document.querySelector('.spreadimg')
          let imgqr = document.querySelector('.spreadqr')
          canvas.getContext('2d').drawImage(imgbg, 0, 0, 600, 1074)
          canvas.getContext('2d').drawImage(imgqr, 195, 460, 210, 210)
          console.log('画图')
          // console.log(imgbg, imgqr)
          this.myqrurl = canvas.toDataURL('image/png')
          this.$root.eventHub.$emit('loading', null)
        } catch (err) {
          this.$root.eventHub.$emit('loading', null)
          console.log(err)
        }
      },
      _initCopy() {
        const clipboard = new ClipboardJS('.copy')
        const that = this
        clipboard.on('success', function (e) {
          that.$root.eventHub.$emit('titps', '已复制到剪贴板')
          console.info('Action:', e.action)
          console.info('Text:', e.text)
          console.info('Trigger:', e.trigger)
          e.clearSelection()
        })
        clipboard.on('error', function (e) {
          console.error('Action:', e.action)
          console.error('Trigger:', e.trigger)
        })
      },
      _showqr() {
        // if (this.myqrurl) {
        //   this.$refs.popup._showPopup()
        //   this.$refs.interlayer._showLayer()
        //   return false
        // }
        const opts = {
          type: 'image/jpeg'
        }
        this.$root.eventHub.$emit('loading', true)
        QRCode.toDataURL(`${this.env === 'dev' ? this.NOWCONFIG.dev_spread : this.NOWCONFIG.spread}?username=${this.$root.user.lower_code}&response_type=code&scope=snsapi_userinfo#wechat_redirect`, opts, (err, url) => {
          if (err) {
            this.$root.eventHub.$emit('titps', '二维码解析出错')
            console.error(err)
          } else {
            // console.log(url)
            this.$refs.qrimg.src = url
          }
        })
      }
    },
    components: {
      back,
      QRCode,
      popup,
      interlayer,
    },
  }
</script>

